INSERT INTO `pages` (`id`, `title`, `slug`, `details`, `meta_tag`, `meta_description`, `header`, `footer`) VALUES
(1, 'About Us', 'about', '<div helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\"><h1 style=\"margin: 0px 0px 5px; padding: 0px; font-size: 36px; font-family: Karla, sans-serif; line-height: 1.35; color: rgb(51, 51, 51); text-align: justify;\"><span style=\"margin: 0px; padding: 0px; font-size: 24px;\">WELCOME TO&nbsp;<span style=\"margin: 0px; padding: 0px; color: rgb(231, 76, 60);\">LOCALAXOM</span></span></h1><h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; color: rgb(93, 93, 93); font-family: Karla, sans-serif; font-size: 15px; text-align: justify;\">WELCOME TO THE WORLD OF GROCERIES AT GO LOCALAXOM BASICALLY WEBSITE IS DESIGNED FOR BOTH CONSUMERS AND VENDORS.IT IS ONLINE SUPERMARKET WHICH DEALS IN OVER ALL DAILY NEEDS ITEMS UNDER YOUR ROOF WEBSITE DEALS IN VARIOUS CATEGORIES LIKE FRESHFRUIT,HOUSEHOLD NEEDS,PERSONAL CARE ETC. 1 IT DEALS IN OVER 3000 PRODUCTS AT REASONABLE PRICE WITH BEST SERVICE</p></h2></div>', NULL, NULL, 0, 1),
(2, 'Privacy & Policy', 'privacy', '<div helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\"><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Privacy Policy</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">This privacy policy has been compiled to better serve those who are concerned with how their ‘Personally identifiable information’ (PII) is being used online. PII is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website dailyshopiee.com.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">What personal information do we collect from the people that visit our website or app?</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">When enquiring, ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, phone number, business details or other details to help you with your experience.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">When do we collect information?</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">We collect information from you when you fill out a form or enter information on our site.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">How do we use your information?</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">We may use the information we collect from you when you register, make a purchase, sign up for our newsletter, surf the website, or use certain other site features in the following ways:</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">To quickly process the communication</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Allowing you to press forward an Order/RFQ</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Do we use ‘cookies’?</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">We do not use cookies for tracking purposes</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser (like Internet Explorer) settings. Each browser is a little different, so look at your browser’s Help menu to learn the correct way to modify your cookies.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">If you disable cookies off, some features will be disabled that make your site experience more efficient and some of our services will not function properly.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Security</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">We take reasonable steps to protect the personal information you share with us from unauthorized access or disclosure. However, you should know that no company, including Simran Software Solutions Private Limited, can fully eliminate security risks associated with personal information.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Your privacy is very important to us. Due to factors beyond our control, however, we cannot fully ensure that your personal information will not be disclosed to other third parties. For example, we may be legally required to disclose information to the government or third parties under certain circumstances, or third parties may unlawfully intercept or access transmissions or private communications.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Changes to the Privacy Policy</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">We may amend this privacy policy at any time by, in our discretion, either: (1) sending you a notice of the amended policy to the email address you have submitted to us (if applicable), in which case you agree to the amended version if you do not contact us to inform us otherwise, or (2) posting the amended version on our web site, in which case you agree to the amended version if you continue to use the web site.</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\"><br></font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">Queries and Changes to Your Personal Information</font></h2><h2 style=\"line-height: 1.44444;\"><font size=\"6\">If you have a question or comment about the dailyshopiee.com site or a request to correct or delete your personal information, please send it to us by using our web site Feedback form. We will use commercially reasonable efforts to fulfill your request in a timely manner. However, even if dailyshopiee.com deletes such personal information from its ‘live’ database(s), it may still be stored on other databases (including those kept for archival purposes).</font></h2></div>', NULL, NULL, 0, 1),
(3, 'Terms & Condition', 'terms', '<div helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\"><h2><font size=\"6\">Terms &amp; Conditions</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">PLEASE READ THE FOLLOWING TERMS AND CONDITIONS OF USE CAREFULLY BEFORE USING THIS WEBSITE. All users of this site agree that access to and use of this site are subject to the following terms and conditions and other applicable law. If you do not agree to these terms and conditions, please do not use this site.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Registration</font></h2><h2><font size=\"6\">Registration for the Service is not required to simply view the Site. If you elect to register for the Service, dailyshopiee.com</font></h2><h2><font size=\"6\">Inc asks you for information that enables us to provide the Service. You will be registering with dailyshopiee.com</font></h2><h2><font size=\"6\">Inc on the form provided and such registration may require you to provide contact information such as your name and email address.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">IP Addresses</font></h2><h2><font size=\"6\">An IP address is a number that’s automatically assigned to your computer whenever you’re surfing the web. Web servers, the computers that “serve” web pages, automatically identify your computer by its IP address. Company collects IP addresses for purposes of system administration, to report aggregate information to third parties and to track the use of the Site. When visitors request pages from the Site or click on a link in a mailing sent through the Service our server’s log the visitors’ IP addresses. We reserve the right to use IP addresses to identify a visitor or list member when it will enhance the users experience or if we feel it is necessary to enforce compliance with the Site’s policies or to protect Company, the Site, its visitors, the Service, our Internet Service Provider partners, the list members or others.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Limitation of Liability</font></h2><h2><font size=\"6\">dailyshopiee.com shall not be liable for any special or consequential damages that result from the use of, or the inability to use, the materials on this site or the performance of the products, even if dailyshopiee.com has been advised of the possibility of such damages. Applicable law may not allow the limitation of exclusion of liability or incidental or consequential damages, so the above limitation or exclusion may not apply to you.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Customer Service</font></h2><h2><font size=\"6\">Based upon the information you provide us, we will communicate with you in response to your inquiries, to provide the services you request, and to manage your account. We may network with you by email or telephone.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Security and Information Protection:</font></h2><h2><font size=\"6\">The security of your information is important to us. When you enter sensitive information (such as a credit card number) on our payment forms, we encrypt that information using Secure Socket Layer (SSL) technology.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">We follow generally accepted industry standards to protect the information submitted to us, both during transmission and once we receive it. No method of transmission over the Internet, or method of electronic storage, is completely secured, however. Therefore, while we strive to use commercially acceptable means to protect your personal information, we cannot guarantee its absolute security.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Use of Site</font></h2><h2><font size=\"6\">Harassment in any manner or form on the site, including via e-mail, chat, or by use of obscene or abusive language, is strictly forbidden. Impersonation of others, including a dailyshopiee.com or other licensed employee, host, or representative, as well as other members or visitors on the site is prohibited. You may not upload to, distribute, or otherwise publish through the site any content which is libelous, defamatory, obscene, threatening, invasive of privacy or publicity rights, abusive, illegal, or otherwise objectionable which may constitute or encourage a criminal offense, violate the rights of any party or which may otherwise give rise to liability or violate any law. You may not upload commercial content on the site or use the site to solicit others to join or become members of any other commercial or other organization.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Changes to this Policy:</font></h2><h2><font size=\"6\">The terms of this Privacy Policy may change from time to time. We will notify you of any material changes to this Privacy Policy by posting a notice on the homepage of the Site for a reasonable period of time after such changes are made, that this Privacy Policy has been updated, and by changing the “Effective” date at the top of this Privacy Policy. We encourage you to check this page periodically for any changes. Your continued use of the Site and participation in following the posting of changes to these terms will mean you accept those changes.</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">CONTACT INFORMATION</font></h2><h2><font size=\"6\"><br></font></h2><h2><font size=\"6\">Questions about the Terms of Service should be sent to us at support@dailyshopiee.com</font></h2></div>', NULL, NULL, 0, 1);
