 21px;\"><div class=\"aplus-module-wrapper\"><div class=\"a-section a-spacing-none a-text-center\" style=\"margin-bottom: 0px; text-align: center !important;\"><img alt=\"HP Laserjet M1005 Multifunction Monochrome Laser Printer\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/c082d075-ffb6-4873-8d94-12032243d67b.__CR1,0,1917,593_PT0_SX970_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/c082d075-ffb6-4873-8d94-12032243d67b.__CR1,0,1917,593_PT0_SX970_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"></div></div></div><div class=\"celwidget aplus-module module-9\" cel_widget_id=\"aplus-m-module-9\" data-csa-c-id=\"nfdexy-5dml5w-fnwute-19iduo\" data-cel-widget=\"aplus-m-module-9\" style=\"min-width: inherit; margin-bottom: 21px;\"><div class=\"aplus-module-wrapper\"><div class=\"\"><h3 class=\"a-spacing-small\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.8rem; line-height: 1.25; margin-bottom: 0.8rem !important;\">Stylish printer for everyday tasks</h3><p class=\"a-text-center\" style=\"padding: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; text-align: center !important;\"><img alt=\"Affordable printing jobs\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/eb185130-6d1e-43f0-acf1-57ac34a31a9a.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/eb185130-6d1e-43f0-acf1-57ac34a31a9a.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Affordable printing jobs</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">The HP Laserjet M1005 is a multifunction laser printer that makes printing jobs easy and affordable. Economode print quality settings prints text with less toner, N-up printing multiple pages per sheet.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"Outstanding text quality\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5a193858-233f-446a-bc72-19fd0b198051.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/5a193858-233f-446a-bc72-19fd0b198051.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Outstanding text quality</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">This monochrome printer gives professional quality crisp and sharp text images.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"Compact design\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/dfe72dbf-77f4-437b-8f27-5f376940ed4d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/dfe72dbf-77f4-437b-8f27-5f376940ed4d.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Compact design</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">The design of this HP Printer M1005 is extremely stylish and compact with contoured sloping top, which gives it an elegant look. This sleek HP Laserjet printer saves a lot of space on your home or office desktop.</p><p style=\"padding: 0px; margin: -0.4rem 0px 0px;\"></p></div></div></div><div class=\"celwidget aplus-module module-9\" cel_widget_id=\"aplus-m-module-9\" data-csa-c-id=\"cmp50z-z5p4uh-e6a3lu-tme43y\" data-cel-widget=\"aplus-m-module-9\" style=\"min-width: inherit; margin-bottom: 21px;\"><div class=\"aplus-module-wrapper\"><div class=\"\"><h3 class=\"a-spacing-small\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.8rem; line-height: 1.25; margin-bottom: 0.8rem !important;\">Works Fast and Saves Money</h3><p class=\"a-text-center\" style=\"padding: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; text-align: center !important;\"><img alt=\"Print more for less\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/168e334f-1330-4c17-8462-c541b811958e.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/168e334f-1330-4c17-8462-c541b811958e.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Print more for less</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">The most remarkable feature of the HP laser M1005 is the Instant On technology that churns out the first print in less than 10 seconds from standstill or low power mode. This helps in getting quality prints and saves energy by reducing the wait time between print jobs.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"Conserve energy\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/380822d3-2e81-4b61-8fb4-59618233e2be.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/380822d3-2e81-4b61-8fb4-59618233e2be.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Outstanding quality</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">Save your energy by Instant-on Technology and Instant-on Copy.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"Fast, versatile performance\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/52d4ed0b-15bc-4dd6-bd44-6e10c6486c76.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/52d4ed0b-15bc-4dd6-bd44-6e10c6486c76.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Fast, versatile performance</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">The printer has a blazing speed and can produce 14 ppm. This smart HP 1020 Plus printer is powered by a high-speed 234 MHz processor with a 2 MB internal memory which offers an easy and simplified printing experience.</p><p style=\"padding: 0px; margin: -0.4rem 0px 0px;\"></p></div></div></div><div class=\"celwidget aplus-module module-9\" cel_widget_id=\"aplus-m-module-9\" data-csa-c-id=\"2is7zk-ud05et-jcgeke-ly7zrj\" data-cel-widget=\"aplus-m-module-9\" style=\"min-width: inherit; margin-bottom: 21px;\"><div class=\"aplus-module-wrapper\"><div class=\"\"><h3 class=\"a-spacing-small\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.8rem; line-height: 1.25; margin-bottom: 0.8rem !important;\">All the features you need</h3><p class=\"a-text-center\" style=\"padding: 0px; margin-right: 0px; margin-bottom: 1.3rem; margin-left: 0px; text-align: center !important;\"><img alt=\"Optical Character Recognition\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/68c997b8-aa36-41f4-aca7-f0fab301f5fc.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/68c997b8-aa36-41f4-aca7-f0fab301f5fc.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">Optical Character Recognition</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">The Great feature of the HP Laserjet printer is the OCR software (Optical Character Recognition), which comes along with the installation drivers and helps convert documents into digital formats for archiving or editing.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"High resolution scans\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/513b0b65-965c-432e-93d9-fe5915f2b455.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/513b0b65-965c-432e-93d9-fe5915f2b455.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bottom: 0.4rem !important;\">High resolution scans</h4><p class=\"a-spacing-base\" style=\"padding: 0px; margin-right: 0px; margin-left: 0px; margin-bottom: 1.2rem !important;\">Flatbed scanning gives high resolution scans of up to 1200 dpi and is perfect for scanning sensitive media like old photographs.</p><p style=\"padding: 0px; margin: -0.4rem 0px 1.3rem;\"></p><p class=\"a-text-center\" style=\"padding: 0px; margin: -0.4rem 0px 1.3rem; text-align: center !important;\"><img alt=\"Bulk printing\" src=\"https://m.media-amazon.com/images/S/aplus-media/vc/71c5f57b-20e9-4ce4-a825-2f709ae7076c.__CR0,0,300,300_PT0_SX300_V1___.jpg\" class=\"a-spacing-mini\" data-src=\"https://m.media-amazon.com/images/S/aplus-media/vc/71c5f57b-20e9-4ce4-a825-2f709ae7076c.__CR0,0,300,300_PT0_SX300_V1___.jpg\" style=\"border: 0px; vertical-align: top; margin-bottom: 0.4rem !important;\"><br></p><h4 class=\"a-spacing-mini\" style=\"padding: 0px 0px 0.4rem; margin-right: 0px; margin-left: 0px; text-rendering: auto; font-weight: 700; font-size: 1.5rem; line-height: 1.35; margin-bo